/* model version */
#define NNOM_MODEL_VERSION (10000*0 + 100*4 + 3)

/* nnom model */
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[11];

	check_model_version(NNOM_MODEL_VERSION);
	new_model(&model);

	layer[0] = input_s(&input_1_config);
	layer[1] = model.hook(conv2d_s(&conv2d_config), layer[0]);
	layer[2] = model.active(act_hard_tanh(CONV2D_OUTPUT_DEC), layer[1]);
	layer[3] = model.hook(flatten_s(&flatten_config), layer[2]);
	layer[4] = model.active(act_hard_tanh(DROPOUT_OUTPUT_DEC), layer[3]);
	layer[5] = model.hook(dense_s(&dense_config), layer[4]);
	layer[6] = model.hook(dense_s(&dense_1_config), layer[5]);
	layer[7] = model.active(act_hard_tanh(DENSE_1_OUTPUT_DEC), layer[6]);
	layer[8] = model.hook(dense_s(&dense_2_config), layer[7]);
	layer[9] = model.active(act_hard_tanh(DENSE_2_OUTPUT_DEC), layer[8]);
	layer[10] = model.hook(output_s(&output0_config), layer[9]);
	model_compile(&model, layer[0], layer[10]);
	return &model;
}
